import React from "react";

export class Checkout extends React.Component {
    render() {
        const { cart } = this.props;
        return (
          <div>
            <h1>Checkout</h1>
            {cart.map(game => (
              <div key={game.title}>
                <h2>{game.title}</h2>
                <p>{game.description}</p>
                <p>Price: ${game.price}</p>
              </div>
            ))}
            <form>
              {/* form elements go here */}
            </form>
          </div>
        );
      }
      
}
